INSERT INTO `konten` (`idKonten`, `judul`, `isi`, `picture`, `generalCats`, `specialCats`) VALUES
(21, 'Biru &amp; Orange', '<!-- [if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]-->\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;">Kamu mengharapkan keceriaan dalam hidup. Hal ini terwujud dengan dua kepribadian yang kamu miliki. Ada saat dimana sifatmu menjadi terbuka, modern dan mampu menjadi pusat perhatian dalam sebuah pesta. Tapi ada juga saat dimana kamu ingin menjadi orang rumahan yang merasa bahagia berada dekat dengan alam. Keinginanmu mengubah segala sesuatu menjadi sempurna sebaiknya dimulai dengan diri dan lingkungan sendiri daripada membuat rencana &ndash; rencana muluk yang berada diluar kontrolmu.</p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; padding-left: 30px;"><strong><em>Kembangkan diri dengan: </em></strong>mengajak teman &ndash; teman mendukung kegiatan &ndash; kegiatan sosial sebagai pengisi waktu luang yang lebih bermanfaat dari sekedar ngerumpi di mall.</p>\r\n<p>&nbsp;</p>\r\n<!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>IN</w:LidThemeOther>\r\n  <w:LidThemeAsian>KO</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>AR-SA</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w:OverrideTableStyleHps/>\r\n   <w:UseFELayout/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val="