Kesabaranmu sering membuat orang merasa dihargai, berbagai cara akan kamu lakukan untuk menghibur kesedihan teman atau keluarga, dari bermain musik sampai membuat lelucon pembangkit tawa. Sifat pendengar membuat orang lain tidak tahu perasaan dan keinginan hatimu yang sebenarnya.</p>\n<p class="MsoNormal" style="text-align: justify; padding-left: 30px;"><em><strong>Kembangkan diri dengan:</strong> </em>mulai lebih terbuka mengungkapkan perasaanmu, teman &ndash; teman dekat pasti akan bersedia membalas jasamu sebagai tempat curhat mereka.</p>', 'blueGreen.png', 'favColor', '2');
