ame="List Table 6 Colorful Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="52"\r\n   Name="List Table 7 Colorful Accent 6"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Table Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin-top:0in;\r\n	mso-para-margin-right:0in;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0in;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:Arial;\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal">Pengejar ilmu pengetahuan. Kamu sudah bosan dengan segala bentuk pergaulan yang tidak mendatangkan manfaat. Keinginanmu untuk menikmati suasana yang lebih tenang dan stabil akan terwujud. Hal ini akan memberi banyak waktu untuk merenungi keberhasilan dan cita &ndash; citamu yang belum tercapai khususnya di bidang pendidikan. Saat yang tepat untuk menyusun prioritas dan mengambil keputusan berdasarkan kepentingan pribadimu. Ingat, tidak ada istilah tua atau terlambat dalam belajar!</p>', '', 'number', '2'),
(33, '#3', '<p>Tahun ini merupakan tahun kesuksesanmu. Bakat yang selama ini terpendam akan mendapat kesempatan terasah bahkan kamu dapat meraih prestasi darinya. Teman dan hobi baru juga akan memeriahkan hidupmu. Jangan terpancing oleh hal &ndash; hal negatif dalam berkawan seperti gosip &ndash; gosipan yang merugikan teman sendiri, lebih baik salurkan hobimu berbicara dengan mengambil les nyanyi atau MC. Biasakan untuk mengungkapkan ide &ndash; idemu, mana tahu teman atau orang lain yang mendengar akan tertarik dan dapat membantumu mewujudkannya.</p>', '', 'number', '2'),
(34, '#6', '<p>Mahkota keindahan rumah tahun ini akan jatuh ke tanganmu. Tahun baru membangkitkan semangatmu untuk mempercantik kamar dan rumah. Kegiatan favorit barumu pun masih berkisar seputar rumah seperti berkebun dan mencoba resep masakan untuk menyenangkan keluarga. Jika penolongmu akan banyak dirasakan oleh teman dan keluarga tetapi jangan membuat mereka tergantung padamu. Ajar orang lain untuk melihat kelebihan mereka dan memanfaatkannya.</p>', '', 'number', '2'),
(35, '#8', '<p>Tahun ini menjanjikan tahun yang penuh kesuksesan. Banyak peluang-peluang emas yang akan memberikan keuntungan baik materi maupun relasi. Walau keadaan materi berlebih tetaplah bijaksana dalam mengunakannya. Pelajari manajemen keuangan agar kamu dapat membuat prioritas pengeluaran penting dan mana yang dapat dikurangi atau dihilangkan. Dalam melaksanakan suatu kegiatan lakukan perencanaan karna inilah yang menjadi kunci keberhasilanmu.</p>', '', 'number', '2'),
(36, '#9', '<p>Tahun baru membawa arti yang lebih untuk rasa kemanusiaanmu. Seiring dengan bertambahnya usia kamu pun mulai merasakan keinginan untuk melakukan sesuatu yang lebih berarti dalam hidup, seperti turut mengambil bagian dalam kegiatan-kegiatan sosial. Pengalaman di masa lalu layak untuk dijadikan pelajaran di masa kini, berbagi pengalaman dengan orang lain pun dapat menjadi salah satu alternatif kegiatan membantu orang lain.</p>', '', 'number', '2'),
(37, '1', '<p>Sebelum mengambil <em>keputusan</em> kamu membutuhkan waktu untuk berfikir dan <strong>membandingkan</strong> baik buruknya akibat keputusanmu.</p>', '', 'HeadOrs', '2'),
(38, '2', '<p>Pada masa <em>pendekatan</em> kamu akan berusaha mengorek semua informasi yang penting dari calon pacar untuk menjadi <strong>bahan pertimbangan</strong> bila nantinya dia / kamu menyatakan perasaan cintanya</p>', '', 'HeadOrs', '2'),
(39, '3', '<p>Menganalisa suatu kejadian dari <strong>berbagai aspek</strong> merupakan salah satu kelebihanmu.</p>', '', 'HeadOrs', '2'),
(40, '4', '<p>Dalam keadaan <em>terdesak</em> kamu akan semakin <strong>kreatif</strong> mencari jalan keluar.</p>', '', 'HeadOrs', '2'),
(41, '5', '<p>Kamu percaya bahwa <strong>segala masalah</strong> pasti memiliki <strong>solusi</strong> bila kita mau memikirkannya.</p>', '', 'HeadOrs', '2'),
(42, '6', '<p>Banyak teman dan keluarga yang datang padamu untuk <strong>curhat</strong> karena menurut mereka kamu adalah <em>pendengar yang baik</em>.</p>', '', 'HeadOrs', '2'),
(43, '7', '<p>Bila sedang kesal pada seseorang kamu akan langsung mencari <strong>sang sumber</strong> dan <em>langsung mengkonfrontasikannya</em>.</p>', '', 'HeadOrs', '2'),
(44, '8', '<p>Adegan mengharukan di film selalu membuatmu <em>tersentuh</em> dan tak jarang kamu pun ikut mencucurkan<strong> air mata</strong>.</p>', '', 'HeadOrs', '2'),
(45, '9', '<p>Kamu<strong> sangat ekspresif</strong> dalam menyatakan perasaanmu sehingga seperti buku yang terbuka, <em>rahasia hatimu mudah terbaca</em>.</p>', '', 'HeadOrs', '2'),
(46, '11', '<p>Jika harus bekerja dalam <strong>satu tim</strong>, maka kamu akan memilih <strong>anggota</strong> tim yang dekat denganmu.</p>', '', 'HeadOrs', '2'),
(47, 'Tipe Perasa (Heart)', '<p style="text-align: justify;">Kamu cenderung untuk memikirkan semua masalah tapi bukan untuk mencari jaln keluar, hanya sekedar merenungi atau meyesali mengapa semua terjadi. Ingat kata pepatah menyesal kemudian tak berguna. Jadi sebelum melakukan sesuatu, luangkan sedikit waktu untuk berfikir agar tidak ada penyesalan di masa depan.</p>\r\n<p style="text-align: justify;"><br />Simpatimu kepada orang lain juga terkadang berlebihan. Tidak ada salahnya membantu orang lain tapi <em>jangan sampai mengorbankan kepentingan diri sendiri</em> untuk orang lain, inilah yang kerap membuatmu <strong>menyesal</strong>.</p>\r\n<p style="text-align: justify;">Jangan terlalu menggebu-gebu dalam mengungkapkan perasaanmu, biasanya sesuatu yang mudah datang akan mudah pula menghilang.</p>', '', 'HeadOrs', '3'),
(48, 'Tipe Pemikir (Head)', '<p>Menganalisa suatu masalah memang dapat memberi gambaran yang jelas tentang untung rugi yang akan diraih, <em>tapi</em> ingatlah tidak semua aspek kehidupan dapat dilihat sebagi <strong>hitam putih</strong> atau untung rugi.</p>\r\n<p>Jangan sampai sifatmu yang sangat <em>rasional</em> ini membuat orang lain berfikir kamu adalah orang yang <strong>dingin</strong> dan <strong>tidak berperasaan</strong>.</p>\r\n<p>Asahlah kepekaan terhadap lingkungan dan orang lain disekitarmu. Usahakan untuk mengambil keputusan kamu tidak hanya menguntungkan diri sendiri tapi juga tidak merugikan orang lain.</p>', '', 'HeadOrs', '3'),
(49, 'Tipe yang Bijaksana (Head and Heart)', '<p>Kamu tahu kapan harus menggunakan <strong>akal sehat(</strong>Head<strong>)</strong> dan kapan harus menggunakan <strong>perasaan(</strong>Heart<strong>).</strong></p>\r\n<p>Kepekaanmu ini membuat orang lain sangat menghargai dan mudah menerimamu baik di lingkungan <em>pergaulan</em> maupun <em>pekerjaan. </em></p>\r\n<p>Kamu sangat cocok menjadi <strong>penasehat</strong> karena kesabaranmu dalam mendengar dan kejelianmu <em>melihat masalah orang lain</em> membuatmu mampu memberikan nasehat yang tepat.</p>', '', 'HeadOrs', '3');

